<style>
  html, body { height: 100%; margin: 0; background: transparent !important; }
  body > div, body > div > div { height: 100% !important; background: transparent !important; } /* ensure folium wrapper divs fill iframe */

    width: 100% !important;
    height: 100% !important;
    border: 0 !important;
    outline: none !important;
    background: transparent !important;
  }

  .leaflet-tile-pane,

  .leaflet-shadow-pane,
  .leaflet-marker-pane,
  .leaflet-tooltip-pane,
  .leaflet-control-container {
    background: transparent !important;
  }
                                             
  /* cover both renderers (Canvas/SVG) */
  canvas.leaflet-zoom-animated,
  svg.leaflet-zoom-animated {
    background: transparent !important;
  }
                                             
  .leaflet-control-attribution { display: none !important; }
                                             
  /* Kill Leaflet's default pointer on interactive paths; re-enable only on our hitboxes */
  .leaflet-interactive { cursor: default !important; }
                                             
  .hitbox-capture { cursor: pointer !important; }
                                             
  path.hitbox-squares { pointer-events: none !important; }
</style>

<script>
document.addEventListener("DOMContentLoaded", function() {
  var map_id = document.querySelector('.folium-map').id;
  var map = window[map_id];
  var HOVER_SCALE = 2;
  var urlBySlug = {"japan": "https://www.falinwa.com/japan", "china": "https://www.falinwa.com/china", "indonesia": "https://www.falinwa.com/indonesia", "france": "https://www.falinwa.com/france", "cambodia": "https://www.falinwa.com/cambodia", "vietnam": "https://www.falinwa.com/vietnam", "singapore": "https://www.falinwa.com/singapore"};

  // Make Folium wrapper divs 100% tall and recalc map size to fit iframe perfectly
  (function ensureFullHeight(){
    var el = document.getElementById(map_id);
    if (el && el.parentElement) el.parentElement.style.height = '100%';
    if (el && el.parentElement && el.parentElement.parentElement) el.parentElement.parentElement.style.height = '100%';
  })();
  function resizeMap(){ if (map && map.invalidateSize) map.invalidateSize(); }
  resizeMap();
  window.addEventListener('resize', resizeMap);

  // Gather dots by slug (L.Circle layers)
  var dotsByCountry = {};
  map.eachLayer(function(layer) {
    if (layer instanceof L.Circle) {
      var cls = (layer.options.className || '');
      var m = cls.match(/dot-country-([a-z0-9\-]+)/);
      if (m) {
        var slug = m[1];
        if (!dotsByCountry[slug]) dotsByCountry[slug] = [];
        layer._origRadius = layer.getRadius();
        dotsByCountry[slug].push(layer);
      }
    }
  });

  function setCountryHover(slug, active) {
    var arr = dotsByCountry[slug] || [];
    if (!arr.length) return;
    var baseColor = arr[0].options.fillColor || '#333333';

    window.requestAnimationFrame(function() {
      for (var i = 0; i < arr.length; i++) {
        var layer = arr[i];
        var r = active ? layer._origRadius * HOVER_SCALE : layer._origRadius;
        layer.setRadius(r);
        if (active) {
          layer.setStyle({ weight: 1, color: baseColor, opacity: 1.0, lineCap: 'round', lineJoin: 'round' });
        } else {
          layer.setStyle({ weight: 0, opacity: 0 });
        }
      }
    });
  }

  // Hover + click handlers on merged hitboxes only
  map.eachLayer(function(layer) {
    if (layer instanceof L.GeoJSON) {
      layer.eachLayer(function(child) {
        var slug = child && child.feature && child.feature.properties && child.feature.properties.slug;
        if (!slug) return;

        child.on('mouseover', function() { setCountryHover(slug, true);  });
        child.on('mouseout',  function() { setCountryHover(slug, false); });

        child.on('touchstart', function() { setCountryHover(slug, true);  });
        child.on('touchend',   function() { setCountryHover(slug, false); });

        child.on('click', function() {
          var target = urlBySlug[slug];
          if (target) window.open(target, '_blank');
        });
      });
    }
  });
});
</script>
